async function getRequestContext(request) {
    const url = new URL(request.url);
    const contentType = request.headers.get('content-type');
    const requestContext = {
        url,
        method: request.method,
        routePath: url.pathname,
        headers: request.headers,
        cookies: mod9.getCookies(request.headers),
        params: {},
        data: {},
        files: []
    };
    url.params = {};
    url.searchParams.forEach((value, key)=>{
        url.params[key] = value;
        requestContext.params[key] = value;
    });
    if (contentType?.startsWith('application/json')) {
        requestContext.data = await request.json();
    } else if (contentType?.startsWith('multipart/form-data') || contentType?.startsWith('application/x-www-form-urlencoded')) {
        const formData = await request.formData();
        for await (const [key, value] of formData){
            if (value instanceof File) {
                requestContext.files.push({
                    content: new Uint8Array(await value.arrayBuffer()),
                    filename: value.name,
                    size: value.size,
                    type: value.type
                });
            } else {
                const data = requestContext.data;
                data[key] = value;
            }
        }
    } else {
        requestContext.data = await request.blob();
    }
    return requestContext;
}
class ResponseContext {
    constructor(){}
    redirect = (url, status)=>{
        return Response.redirect(url, status);
    };
    send = (body, init)=>{
        return new Response(body, init);
    };
    json = (body, status)=>{
        return new Response(JSON.stringify(body), {
            status: status || 200,
            headers: {
                'content-type': 'application/json'
            }
        });
    };
    text = (body, status)=>{
        return new Response(body, {
            status: status || 200,
            headers: {
                'content-type': 'text/plain'
            }
        });
    };
    html = (body, status)=>{
        return new Response(body, {
            status: status || 200,
            headers: {
                'content-type': 'text/html'
            }
        });
    };
    stream = (fn, init)=>{
        let controller = null;
        let closed = false;
        const rs = new ReadableStream({
            start: (ctrl)=>{
                controller = ctrl;
                fn((data, onClose)=>{
                    if (closed || !controller) {
                        if (onClose) onClose();
                        return;
                    }
                    try {
                        controller.enqueue(data);
                    } catch (e) {
                        mod5.error('Failed to push to stream:', e.message);
                        controller = null;
                        closed = true;
                        throw e;
                    }
                });
            },
            cancel () {
                closed = true;
                controller = null;
                mod5.info('Stream closed by client');
            }
        });
        return new Response(rs, init);
    };
}
